import logo from "./logo.svg";
import "./App.css";
import {   BrowserRouter as Router,Route, Switch } from "react-router";
import About from "./About/About";
import Services from "./Services/Services";

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/about">
          <About></About>
        </Route>
        <Route path="/services">
          <Services></Services>
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
